import React from "react"
import Navbar from "./Navbar.js"
import Card from "./Card.js"
import data from "../data.js"
import "../styles.css"


export default function App() {
    const cards = data.map((item) => 
      <Card
      {...item}
      />
    )
    return (
      <div className="box">
        <Navbar />
        {cards}
      </div>
    )
}
